import "bootstrap/dist/css/bootstrap.min.css";
import { Navbar, Nav, FormControl } from "react-bootstrap";

function Navibar() {
  return (
    <Navbar className=" round-corners" bg="white" variant="light">
      <Navbar.Brand href="#">
        <div className="logo">
          <div className="red-circle"></div>
        </div>
      </Navbar.Brand>
      <FormControl
        id="searchbar"
        type="text"
        placeholder="Search"
        className="searchbar"
      />
      <Nav className="mx-5">
        <Nav.Link href="#">Messages</Nav.Link>
        <Nav.Link href="#">Account</Nav.Link>
      </Nav>
    </Navbar>
  );
}

export default Navibar;
